import React from 'react';
import Post from './post/post';
import AddPostContainer from "./addPost/addPost-container";
import ProfileContainer from "./profile/profileContainer";
import Redirect from "react-router-dom/es/Redirect";



const Content = (props) => {
    if (props.isAuth==false) <Redirect to={"/login"} />
 alert(props.isAuth)
    let dialogsPost = props.profilePage.postData.map(post => <Post message={post.message} like={post.like}/>);
    return ( <div> <ProfileContainer/> <AddPostContainer/> {dialogsPost} </div>)
}
export default Content;
